import React, { useState } from "react";
import { Container, Form, Button, Alert } from "react-bootstrap";

const Dashboard = () => {
  const [formData, setFormData] = useState({
    skills: "",
    educationLevel: "",
    degree: "",
    experience: "",
    jobRole: "",
  });

  const [response, setResponse] = useState("");
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setResponse("");

    try {
      const res = await fetch("http://localhost:5000/api/career-recommendation", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      const data = await res.json();
      setResponse(data.recommendations || "No recommendations available.");
    } catch (error) {
      setResponse("Error fetching career recommendations.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container className="mt-5">
      <h2 className="text-center">Skill Gap Analysis & Career Recommendations</h2>
      <Form onSubmit={handleSubmit} className="mt-4">
        <Form.Group className="mb-3">
          <Form.Label>Skills</Form.Label>
          <Form.Control type="text" name="skills" placeholder="Enter your skills" value={formData.skills} onChange={handleChange} required />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Education Level</Form.Label>
          <Form.Select name="educationLevel" value={formData.educationLevel} onChange={handleChange} required>
            <option value="">Select your education level</option>
            <option value="High School">High School</option>
            <option value="Diploma">Diploma</option>
            <option value="Bachelor’s Degree">Bachelor’s Degree</option>
            <option value="Master’s Degree">Master’s Degree</option>
            <option value="PhD">PhD</option>
          </Form.Select>
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Degree</Form.Label>
          <Form.Control type="text" name="degree" placeholder="Enter your degree (if any)" value={formData.degree} onChange={handleChange} />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Years of Experience</Form.Label>
          <Form.Control type="number" name="experience" placeholder="Enter years of experience" value={formData.experience} onChange={handleChange} />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Desired Job Role</Form.Label>
          <Form.Control type="text" name="jobRole" placeholder="Enter your desired job role" value={formData.jobRole} onChange={handleChange} required />
        </Form.Group>

        <Button variant="primary" type="submit" className="w-100" disabled={loading}>
          {loading ? "Analyzing..." : "Get Career Recommendations"}
        </Button>
      </Form>

      {response && (
        <Alert className="mt-4" variant="success">
          <h4>AI Recommendations</h4>
          <p>{response}</p>
        </Alert>
      )}
    </Container>
  );
};

export default Dashboard;
